import React from 'react'
import clrSVG from './Vector.svg'

function ClarIco({name, color, size, className}) {

    return(
      <svg className={`icon icon-${name} ${className}`} fill={color} stroke={color} width={size} height={size}>>
        <use xlinkHref={`${clrSVG}#icon-${name}`} />
      </svg>
    )
  }
  
  export default ClarIco;
